import React from 'react';
import './App.css';

class App extends React.Component{


constructor(props){
  super(props);
}

render() {

  return (
    <div id='User'>
     <div id='header'>
      <label id='name'>{this.props.name}</label>
      <label id='prof'>{this.props.occupation}</label>
     </div>
     <div id='email'>
      <label>{this.props.email}</label>
     </div>
     <div id='body'>
     <label>Bio...</label>
     <div id='bio_div'>
     <p id='page'>{this.props.page}</p>
     </div>
     </div>
    </div>
  );

}

}

export default App;
